package main

import (
	"fmt"
	"strconv"
	"time"
)

func main() {
	// fmt.Println(robotWithString("bdda"))
	now := time.Now().UnixMilli()
	fmt.Println(robotWithString(""))
	fmt.Println("time used:" + strconv.Itoa(int(time.Now().UnixMilli()-now)))
}

func robotWithString(s string) string {
	// TODO: to be fixed
	minIdx := make([]int, len(s))
	minIdx[len(s)-1] = len(s) - 1
	for i := len(s) - 2; i >= 0; i-- {
		if s[i] <= s[minIdx[i+1]] {
			minIdx[i] = i
		} else {
			minIdx[i] = minIdx[i+1]
		}
	}
	var p string
	var result string
	for i := 0; i < len(s); i++ {
		idx := minIdx[i]
		for len(p) > 0 && p[len(p)-1] <= s[idx] {
			result += string(p[len(p)-1])
			p = p[:len(p)-1]
		}
		p += string(s[i:idx])
		result += string(s[idx])
		i = idx

	}
	for i := len(p) - 1; i >= 0; i-- {
		result += string(p[i])
	}

	return result
}
